// конструктор на модела
MEIRO.Models.M27461 = function M27461(room)
{
	MEIRO.Model.apply(this, arguments);

	// геометрия
	var geometry = new THREE.IcosahedronGeometry(2.5,3);

	// текстура
	// преобразувана с http://dataurl.net/#dataurlmaker
	var earthData = 'data:image/png;base64,';
	var earth = new THREE.TextureLoader().load(earthData);

	// материали
	var materialBack = new THREE.MeshBasicMaterial({
		color: 'cornflowerblue',
		transparent: true,
		opacity: 0.5,
		side: THREE.BackSide,
		map:earth});
	var materialFront = new THREE.MeshBasicMaterial({
		color: 'cornflowerblue',
		transparent: true,
		opacity: 0.5,
		side: THREE.FrontSide,
		map:earth});

	// земя 1
	this.earth1B = new THREE.Mesh(geometry,materialBack);
	this.earth1B.renderOrder = 0;
	this.earth1F = new THREE.Mesh(geometry,materialFront);
	this.earth1F.renderOrder = 5;
	
	// земя 2
	this.earth2B = new THREE.Mesh(geometry,materialBack.clone());
	this.earth2B.material.color = new THREE.Color('tomato');
	this.earth2B.scale.setScalar(0.5);
	this.earth2B.renderOrder = 1;
	this.earth2F = new THREE.Mesh(geometry,materialFront.clone());
	this.earth2F.material.color = new THREE.Color('tomato');
	this.earth2F.scale.setScalar(0.5);
	this.earth2F.renderOrder = 4;
	
	// сглобяване на целия модел
	this.image.add(this.earth1B,this.earth1F,this.earth2B,this.earth2F);
}

MEIRO.Models.M27461.prototype = Object.create(MEIRO.Model.prototype);

MEIRO.Models.M27461.DIST = {MIN:5, MAX:20, HEIGHT:0};
MEIRO.Models.M27461.POS = {DIST:10, ROT_X:0, ROT_Y:0};
MEIRO.Models.M27461.ROT_Y = {MIN:-0.1, MAX:0.7};


// аниматор на модела
MEIRO.Models.M27461.prototype.onAnimate = function(time)
{
	this.earth1B.rotation.y = rpm(time,5);
	this.earth1F.rotation.y = rpm(time,5);
	
	this.earth2B.rotation.y = rpm(time,15);
	this.earth2F.rotation.y = rpm(time,15);
	this.earth2B.rotation.x = rpm(time,17);
	this.earth2F.rotation.x = rpm(time,17);

	this.earth2B.position.y = -1+Math.abs(2*Math.sin(rpm(time,20)));
	this.earth2F.position.y = this.earth2B.position.y;
	
	reanimate();
}



// информатор на модела
MEIRO.Models.M27461.prototype.onInfo = function(element)
{
	var s = '';
	s += '<h1>Текстура с α-канал</h1>';

	s += '<p>Специалният α-канал в текстура определя степента на прозрачност на всеки тексел. Ако данните в този канал поддържат много стойности (например, при 8-битов канал има по 256 стойности), то прозрачността може да е на различни степени за всеки тексел.</p>';
	element.innerHTML = s;
}
